"use strict";
(function(){var a={};
a.name="navigation";
a.COOKIE_NAME="shell_hide_cookie_info";
a.COOKIE_EXPIRY=365;
a.init=function(){shell.registerComponent(a);
$(document).ready(function(){a.enable()
})
};
a.enable=function(){if($("#cookie_info").length===0){$.cookie(a.COOKIE_NAME,null);
return
}if($.cookie(a.COOKIE_NAME)!=="true"){$("#cookie_info").fadeIn();
$.cookie(a.COOKIE_NAME,"true",{path:"/",expires:a.COOKIE_EXPIRY})
}$("#cookie_info .button").click(function(){$("#cookie_info").slideUp("fast")
})
};
a.flush=function(){$.cookie(a.COOKIE_NAME,null);
$("#cookie_info").removeAttr("css")
};
a.init()
})();